     * @param value The amount of tokens to be spent.
     */
    function approve(
        address spender,
        uint256 value
    ) public override onlyValidAddress(spender) returns (bool) {
        _allowance[msg.sender][spender] = value;

        emit Approval(msg.sender, spender, value);

